import React, { useState } from 'react'
import KeyboardBackspaceIcon from '@mui/icons-material/KeyboardBackspace';
import { useNavigate } from 'react-router-dom';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import BusinessCenterIcon from '@mui/icons-material/BusinessCenter';
import { Avatar, Button } from '@mui/material';
import CalendarMonthIcon from '@mui/icons-material/CalendarMonth';
import Tab from '@mui/material/Tab';
import Box from '@mui/material/Box';
import TabContext from '@mui/lab/TabContext';
import TabList from '@mui/lab/TabList';
import TabPanel from '@mui/lab/TabPanel';
import TweetCard from '../HomeSection/TweetCard';
import ProfileModel from './ProfileModel';

const Profile = () => {
    const [value, setValue] = React.useState("1");
    const navigate = useNavigate();
    const handleBack = () => navigate(-1);
    const [OpenProfileModel, setOpenProfileModel] = useState(false);
    const handleOpenProfileModel = () => setOpenProfileModel(true);
    const handleClose = () => setOpenProfileModel(false);

    const handleTabChange = (event, newValue) => {
        setValue(newValue);
        if (newValue == 4) {
            console.log("tab 4")
        }
        else if (newValue == 1) {
            console.log("Users tweets")
        }
    };

    const handleFollowUser = () => {
        console.log("handleFollowUser")
    }

    return (
        <div>
            <section className='{z-50  items-center sticky top-0 bg-opacity-95}'>
                <KeyboardBackspaceIcon className='cursor-pointer' onCLick={handleBack} />
                <h1 className='py-5 text-x1 font-bold opacity-90 ml-5'>Username</h1>

            </section>

            <section>
                <img className='w-[100%] h-[15rem] object-cover' src='https://cdn.pixabay.com/photo/2016/11/02/11/08/monk-1791113_640.jpg' alt='' />
            </section>
            <section className='pl-6'>
                <div className="flex justify-between items-start mt-5 h-[5rem]">
                    <Avatar className='transform -translate-y-24' alt='username' src='data:image/png;base64,'
                        sx={{ width: "10rem", height: "10rem", border: "4px solid white" }}
                    />
                    {true ? <Button onCLick={handleOpenProfileModel} variant='contained' sx={{ borderRadius: "20px" }}>Edit Profie</Button> :
                        <Button onCLick={handleFollowUser} variant='contained' sx={{ borderRadius: "20px" }}>{true ? "Follow" : "Unfollow"}</Button>}

                </div>
                <div>
                    <div className='flex items-center'>
                        <h1 className='font-bold text-lg'> username </h1>
                        {true && (<img className='ml-2 w-5 h-5' src="data:image/png;base64," />)}
                    </div>
                    <h1 className='text-gray-500'>@Use naem</h1>
                </div>
                <div className="mt-2 space y-3">
                    <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Repudiandae possimus optio consequatur dolore, quia voluptas! Necessitatibus nostrum non, perferendis amet eius ipsum asperiores iure sapiente quo qui itaque, iusto nobis! </p>
                    <div className="py-1 flex space-x-5">
                        <div className="flex items-center text-gray-500">
                            <BusinessCenterIcon />
                            <p className='ml-2'>edcation </p>
                        </div>
                        <div className="flex items-center text-gray-500">
                            <LocationOnIcon />
                            <p className='ml-2'>Indian </p>
                        </div><div className="flex items-center text-gray-500">
                            <CalendarMonthIcon />
                            <p className='ml-2'>Joined at june-2022 </p>
                        </div>
                    </div>
                    <div className="flex items-center space-x-5">
                        <div className="flex items-center space-x-1 font-semibold">
                            <span>400</span> <span className='text-gray-500'>Followers</span>
                        </div>
                        <div className="flex items-center space-x-1 font-semibold">
                            <span>400</span><span className='text-gray-500'>Following</span>
                        </div>
                    </div>
                </div>
            </section>
            <section className='py-5'>
                <Box sx={{ width: '100%', typography: 'body1' }}>
                    <TabContext value={value}>
                        <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
                            <TabList onChange={handleTabChange} aria-label="lab API tabs example">
                                <Tab label="Tweets" value="1" />
                                <Tab label="Replies" value="2" />
                                <Tab label="Media" value="3" />
                                <Tab label="Likes" value="4" />
                            </TabList>
                        </Box>
                        <TabPanel value="1">
                            {[1, 1, 1, 1, 1].map((item) => <TweetCard />)}
                        </TabPanel>
                        <TabPanel value="2">User Replies</TabPanel>
                        <TabPanel value="3">Media</TabPanel>
                        <TabPanel value="4">Likes</TabPanel>
                    </TabContext>
                </Box>
            </section>
            <section><ProfileModel handleClose={handleClose} open={OpenProfileModel} /> </section>
        </div>
    );
};

export default Profile
